Three years ago, Yun Qing Yan accidentally fell into the Immortal Realm from the Mortal Realm. After three thousand years, Yun Qing Yan became the great Emperor Yun of the Immortal Realm. Breaking through the barrier between the two realms, Yun Qing Yan discovered that only three years had passed. &quot;Before, I was too weak to protect my loved ones. Now, I'll make the whole world bow before me.&quot;

[b][u]French / Fran&ccedil;ais[/u][/b]
[spoiler]Il y a trois ans, Yun Qingyan est accidentellement entr&eacute; dans le monde immortel. Et apr&egrave;s trois mille ans pass&eacute;s dans ce monde, il a pu devenir l'empereur des nuages ​​immortels. Yun Qingyan a pu retourner dans son monde en cr&eacute;ant une incision dans le vide. Il n'avait aucun pouvoir auparavant pour prot&eacute;ger ceux qu'il aimait, maintenant qu'il est revenu, il veut faire ramper le monde entier sous ses pieds et &eacute;tablir un contr&ocirc;le sur le monde toute entier.[/spoiler]

Mafia boss Wang Tianxia declared his intention of leading his brothers to turn away from illegal business, however was assassinated out of the blues. What he did not expect was that his soul would possess the body of a student instead of dying. And for that student to actually be the school&rsquo;s number one loser...

