Apr&egrave;s 20 ann&eacute;es de travail acharn&eacute;, Wang Tianxia est enfin parvenu &agrave; unifier la p&egrave;gre de C-City. Mais un soir, lors d'une transaction, il se fait tirer dessus par un sniper et se r&eacute;veille, &agrave; sa grande surprise, dans le corps de Chen Jiong, un jeune coll&eacute;gien de la ville victime de harc&egrave;lement scolaire...

&quot;Let's have fun together in the Railway Club!&quot;
Tenman Sora has fallen in an unrequited love for the Railway Club's Mahiro-sensei!
&quot;No matter how thorny the trains may be, if it's for Sensei, just bring it on...&quot;
