&quot;A tranquil village. Full of friendly and warm folks. I used to think this would last forever. Until that day arrived.&quot; 

The Langue, who lived for love, were a race that held jewels within their chest. When jewel hunters raided the peaceful village, Viola lost her entire family, and was soon captured by slave traders. She still held hope of rescue when a person appeared before her, claiming to be from the Langue Clan. Instead, Serette bought Viola as a slave for the Duke of Troy. 

When Viola met the Duke, she asked for her return to the village, only to learn the cruel fate of the Langue captured as slaves. Saddened by the loss of her home, Viola was comforted by Serette, who urged her to help the Duke so that she could bring justice to her people. For the sake of both her and the Langue Clan&rsquo;s survival, Viola's struggle finally begins!

&quot;What would you do if I told you I always wanted to be alone with you...?&quot; 

&quot;We've been friends forever!&quot; 

Me, Aki and Tetsuji have been friends since we were kids. We all love games and we're always together. But everything changed once we got to experience a game called &quot;Real Game&quot;... with a love setting, nonetheless! Tetsuji and Aki ignored my questions completely and just went ahead, making me the main character of the game. Kissing in secret, getting teased in a closet...! This is a virtual love game that seems too real, played by three guys and I'm the only one reacting!

